import React, { Component } from "react";

export default class PostBook extends Component {
  render() {
    return (
      <div className="row">
        <form>
          <div class="mb-3">
            <label class="form-label">ชื่อหนังสือ</label>
            <input type="text" class="form-control" placeholder="ชื่อหนังสือ" />
          </div>

          <label>วันที่เริ่มอ่าน</label>
          <input placeholder="วันที่เริ่มอ่าน" type="text" />
          <label>วันที่อ่านจบ</label>
          <input placeholder="วันที่อ่านจบ" type="text" />
          <label>ชื่อคนเขียน</label>
          <input placeholder="ชื่อคนเขียน" type="text" />
          <label>รูปปก</label>
          <input placeholder="รูปปก" type="text" />
        </form>
        <div class="alert alert-primary" role="alert">
          A simple primary alert—check it out!
        </div>
      </div>
    );
  }
}
